function Header() {
  return (
    <div className="header">
      <div className="logo"></div>
      <div className="menu">
        <div className="menuContainer">
          <span>Home</span>
          <span>About</span>
          <span>Skill</span>
          <span>Experience</span>
          <span>Works</span>
          <span>Contact</span>
        </div>
      </div>
    </div>
  );
}
export default Header;
